import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./pages/Home";
import Profile from "./pages/Profile";

function App() {
  return (
    <Router>
      <Route path="/profile" component={Profile}></Route>
      <Route path="/" exact component={Home}></Route>
    </Router>
  );
}

export default App;
